import './App.css';
import { Route, BrowserRouter, Switch} from "react-router-dom"; 
import routes from './config/routes';
import { isRegistered } from './utils/cookie';

const CobaRoute = ({component:Component, ...rest}) => {
  return (
    <Route {...rest}
      render = {() => {
        if (isRegistered()) {
          window.location.replace('/register');
          return <Component />
        }
        else {
          window.location.replace('/');
          return <Component />
        }
      }}
    />
  )
}

const App = () => {
  return (
    <BrowserRouter>
      <Switch>
        {routes.map((route) => {
            return (
              <CobaRoute
                path={route.path} 
                exact component={route.component} 
                key={route.path}
              />
            )
        })}
      </Switch>
    </BrowserRouter>
  );
}

export default App;
